    with open(file_path, 'r') as file:
        words = file.read().lower().split()
        return Counter(words)

# Define the function to get the top-5 words with the most occurrences
def get_top_words(word_counts):
    return word_counts.most_common(5)

# Define the function to print the top-5 words with the most occurrences
def print_top_words(words):
    for word, count in words:
        print(f"{word}: {count}")

# Define the main function to read all the text files under the directory and print the top-5 words
def main():
    word_counts = {}
    for root, dirs, files in os.walk(directory_path):
        for file in files:
            file_path = os.path.join(root, file)
            word_counts.update(count_words(file_path))
    top_words = get_top_words(word_counts)
    print_top_words(top_words)

if __name__ == '__main__':
    main()
